import React from 'react';

const Card = (props) => {
    return (
        <div className="card" >
            <img src={props.urlImagen} className="card-img-top" alt="..."/>
                <div className="card-body">
                    <h2>{props.titulo}</h2>
                    <p className="card-text">{props.descripcion}</p>
                </div>
        </div>
    )
}
export default Card;
